import React, { Component } from 'react'
import Button from '@material-ui/core/Button';

export default class AddressInput extends Component {
    state={
        startingPoint: '',
        destination: ''
    }

    render() {
        return (
            <div>
                <h2>Commute Better</h2>
                <form onSubmit={this.handleSubmit} style={{display:'block'}}>
                <input style={{padding: '0px 15px',border: '1.5px solid #00d563', color: '#8e8e8e', borderRadius: '4px', width: '25%', height: '40px', marginBottom: '20px'}} type ='text' name='startingPoint' id='startingPoint' value={this.state.username} onChange={this.handleChange} placeholder='Email account'/><br/>
                <input style={{padding: '0px 15px',border: '1.5px solid #00d563', color: '#8e8e8e', borderRadius: '4px', width: '25%', height: '40px', marginBottom: '20px'}} type ='text' name='destination' id='destination' value={this.state.username} onChange={this.handleChange} placeholder='Email account'/><br/>
                <Button type='submit'style={{color:'white', backgroundColor: '#1a1617', fontFamily: 'Lucida Std', textTransform: 'none', width: '200px', marginTop: '20px'}}>Save</Button>
                </form>
            </div>
        )
    }
}
